import React from 'react';
import './register.css';

const Register = ({ onSwitch }) => {
  return (
    <div className="overlay">
      <form>
        <div className="con">
          <header className="head-form">
            <h2>Registrieren</h2>
            <p>Bitte fülle alle Felder aus, um ein neues Konto zu erstellen</p>
          </header>

          <div className="field-set">
            <input className="form-input" type="text" placeholder="Vorname" required />
            <input className="form-input" type="text" placeholder="Nachname" required />
            <input className="form-input" type="email" placeholder="E-Mail" required />
            <input className="form-input" type="password" placeholder="Passwort" required />
            <button className="log-in">Registrieren</button>
          </div>

          <div className="other">
            <button type="button" className="btn submits log-in" onClick={onSwitch}>
              Zurück zum Login
            </button>
          </div>
        </div>
      </form>
    </div>
  );
};

export default Register;
